import React, {useState} from 'react';

const useInputValue = initialValue => {
    const [tempInput,setItem] = useState(initialValue)
    return{
        tempInput,
        onChange: e =>setItem(e.target.value)
    }
}
export default ()=>{
    const text = useInputValue("")

    return (
        <div>
            <input {...text}/>
        </div>
    )
}
